Parsers:
  PixelCameraParser1:
    Regex: ^PXL_(\d{4})(\d{2})(\d{2})_(\d{2})(\d{2})(\d{2})
    YearIndex: 1
    MonthIndex: 2
    DayIndex: 3
    HoursIndex: 4
    MinutesIndex: 5
    SecondsIndex: 6
    MillisecondsIndex: -1
  PixelScreenshotParser1:
    Regex: ^Screenshot_(\d{4})(\d{2})(\d{2})-(\d{2})(\d{2})(\d{2})
    YearIndex: 1
    MonthIndex: 2
    DayIndex: 3
    HoursIndex: 4
    MinutesIndex: 5
    SecondsIndex: 6
    MillisecondsIndex: -1